import Vue from 'vue';
import Vuex from 'vuex';
import navCollapse from './navCollapse'
Vue.use(Vuex);
const test = {
    navCollapse
}
console.log(test,'---------')

const store = new Vuex.Store({
    state:{},
    mutations:{},
    actions:{},
    getters:{},
    modules:{
        ...navCollapse,
    }
})

export default store;
